import { StackNavigator } from "react-navigation";

import Home from "./screens/Home";
import Login from "./screens/Login";

export const zfv = StackNavigator({
    Home: {
    screen: Home,
    navigationOptions: {
      title: "Home"
    }
  },
  Login: {
    screen: Login,
    navigationOptions: {
      title: "Login"
    }
  }
});
